import { GoogleMap, PolygonF, MarkerF, useJsApiLoader } from '@react-google-maps/api';
import React from 'react';

const containerStyle = {
  width: '100%',
  height: '600px',
};

const center = {
  lat: 23.3441,
  lng: 85.3096,
};

const iconUrls = {
  P1: "URL_TO_ICON_1",
  P2: "URL_TO_ICON_2",
  P3: "URL_TO_ICON_3",
  P4: "URL_TO_ICON_4",
};

const iconCoordinates = {
  P1: { lat: 23.467, lng: 85.268 },
  P2: { lat: 23.445, lng: 85.325 },
  P3: { lat: 23.457, lng: 85.310 },
  P4: { lat: 23.435, lng: 85.300 },
};

const districtCoords = [
  [
    { lat: 23.467, lng: 85.268 },
    { lat: 23.464, lng: 85.310 },
    { lat: 23.445, lng: 85.325 },
    { lat: 23.455, lng: 85.275 },
  ],
  [
    { lat: 23.445, lng: 85.325 },
    { lat: 23.445, lng: 85.365 },
    { lat: 23.425, lng: 85.365 },
    { lat: 23.425, lng: 85.325 },
  ],
];

const MapComponent = () => {
  const { isLoaded } = useJsApiLoader({
    id: 'google-map-script',
    googleMapsApiKey: "YOUR_API_KEY",
  });

  return isLoaded ? (
    <GoogleMap mapContainerStyle={containerStyle} center={center} zoom={8}>
      {districtCoords.map((coords, index) => (
        <PolygonF
          key={index}
          paths={coords}
          options={{
            fillColor: ['#FF0000', '#00FF00', '#0000FF'][index], // Different colors
            strokeColor: '#000000',
            strokeWeight: 2,
            fillOpacity: 0.6,
          }}
        />
      ))}

      {Object.entries(iconCoordinates).map(([key, position]) => (
        <MarkerF
          key={key}
          position={position}
          icon={{
            url: iconUrls[key],
            scaledSize: new window.google.maps.Size(32, 32),
          }}
          label={{
            text: key,
            fontSize: '12px',
            color: 'white',
          }}
        />
      ))}
    </GoogleMap>
  ) : <></>;
};

export default MapComponent;
